import React from "react";
import Netflix from "./Netflix";
import Amazon from "./Amazon";


const myfavS = "Amazon";





const App = () =>{
                    return(
                                <>
                                
                                <h2>List of Top 5 Netflix web Series</h2>
                                <div className="Main">
                                {(myfavS == "Netflix") ? <Netflix/> : <Amazon/>}
                                </div>
                                </>
                    );
        }


        export default App;
